var manual = metadata.ss_manual_control;
if (manual == "true") return;

var state = metadata.shared_nutrients1;
var schedule = JSON.parse(metadata.ss_nutrients_schedule).nutrients1;
var repeat = schedule.repeat;
var duration = schedule.duration;
var last = schedule.last;
var next = schedule.next;
var off = schedule.off;

var now = new Date().getTime()/1000;

if (state == "true") {
    //Pump is on
    if (now >= off) {
        //Pump needs to be turned off
        if (now >= next) {
            return ['off', 'update']
        } else {
            return ['off']
        }
    } else return []
} else {
    //Pump is off
    if (now >= next) {
        //Pump needs to be turned on
        //Last, next, and off need to be updated
        return ['on', 'update']
    } else if (now >= last && now < off) {
        return ['on']
    } else return [""]
}

var mainSchedule = JSON.parse(metadata.ss_nutrients_schedule);
var schedule1 = mainSchedule.nutrients1;
var schedule2 = mainSchedule.nutrients2;
var schedule3 = mainSchedule.nutrients3;

var now = new Date().getTime()/1000;

var newSchedule = {
  "nutrients1": {
    "repeat": schedule1.repeat,
    "duration": schedule1.duration,
    "last": schedule1.last,
    "next": schedule1.next,
    "off": schedule1.off
  },
  "nutrients2": {
    "repeat": schedule2.repeat,
    "duration": schedule2.duration,
    "last": now,
    "next": now+schedule2.repeat,
    "off": now+schedule2.duration
  },
  "nutrients3": {
    "repeat": schedule3.repeat,
    "duration": schedule3.duration,
    "last": schedule3.last,
    "next": schedule3.next,
    "off": schedule3.off
  }
};

return {msg: {nutrients_schedule: newSchedule}, metadata: metadata, msgType: "POST_ATTRIBUTES_REQUEST"};

